import React, { useEffect } from "react";
import { LuListTodo } from "react-icons/lu"; // Icon for "Project"
import { IoCalendarNumber } from "react-icons/io5"; // Icon for "Calendar"
import { FaRegNoteSticky } from "react-icons/fa6"; // Icon for "Notes"
import { BiLogOut, BiSolidDashboard } from "react-icons/bi"; // Icons for "Dashboard" and "Logout"
import { MdFocusCamera } from "react-icons/md"; // Icon for "Focus"
import { AiOutlineSchedule, AiOutlineBarChart } from "react-icons/ai"; // Icons for "TimeTable" and "Report"
import { useNavigate } from "react-router-dom";
import icon from "../utils/icon.PNG";
import Aos from "aos";
import "aos/dist/aos.css";
import { toast } from "react-toastify";

const Navbar = () => {
  const navigate = useNavigate();

  useEffect(() => {
    Aos.init({ duration: 800 });
  }, []);

  function openDashboard() {
    navigate("/Home");
  }
  function openProject() {
    navigate("/Home/projects");
  }
  function openFocus() {
    navigate("/Home/focus");
  }
  function openTimeTable() {
    navigate("/Home/timetable");
  }
  function openCalendar() {
    navigate("/Home/calendar");
  }
  function openReport() {
    navigate("/Home/report");
  }

  function logOut() {
    toast.success("Logged out successfully (mock)");
    navigate("/");
  }

  return (
    <nav className="nav-left" data-aos="fade-right">
      <button className="todo-theme">
        <img src={icon} alt="" />
      </button>
      <button onClick={openDashboard} className="nav-icon skull">
        <BiSolidDashboard size={22} color="white" />
      </button>
      <button onClick={openProject} className="nav-icon skull">
        <LuListTodo size={20} color="white" />
      </button>
      <button onClick={openFocus} className="nav-icon skull">
        <MdFocusCamera size={20} color="white" />
      </button>
      <button onClick={openTimeTable} className="nav-icon skull">
        <AiOutlineSchedule size={20} color="white" />
      </button>
      <button onClick={openCalendar} className="nav-icon skull">
        <IoCalendarNumber size={20} color="white" />
      </button>
      <button onClick={openReport} className="nav-icon skull">
        <AiOutlineBarChart size={20} color="white" />
      </button>
      <button className="nav-icon skull" onClick={logOut}>
        <BiLogOut size={22} color="white" />
      </button>
    </nav>
  );
};

export default Navbar;
